public class CaptchaBean extends BaseBean {


    /**
     * data : {"captchaBase64":"data:image/jpeg;base64,","uuid":"DbdeAdB1"}
     */

    private DataBean data;

    public DataBean getData() {
        return data;
    }

    public void setData(DataBean data) {
        this.data = data;
    }

    public static class DataBean {
        /**
         * captchaBase64 : data:image/jpeg;base64,
         * uuid : DbdeAdB1
         */

        private String captchaBase64;
        private String uuid;

        public String getCaptchaBase64() {
            return captchaBase64;
        }

        public void setCaptchaBase64(String captchaBase64) {
            this.captchaBase64 = captchaBase64;
        }

        public String getUuid() {
            return uuid;
        }

        public void setUuid(String uuid) {
            this.uuid = uuid;
        }
    }
}
